(10, 1, '2024-09-04 08:51:46', '2024-09-04 08:51:46', '<!-- wp:template-part {\"slug\":\"header\",\"theme\":\"twentytwentyfour\",\"area\":\"header\"} /-->\n\n<!-- wp:group {\"metadata\":{\"categories\":[\"banner\",\"about\",\"featured\"],\"patternName\":\"twentytwentyfour/text-title-left-image-right\",\"name\":\"Title text and button on left with image on right\"},\"align\":\"full\",\"style\":{\"spacing\":{\"margin\":{\"top\":\"0\",\"bottom\":\"0\"},\"padding\":{\"top\":\"var:preset|spacing|50\",\"bottom\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|50\",\"right\":\"var:preset|spacing|50\"}}},\"backgroundColor\":\"accent\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignfull has-accent-background-color has-background\" style=\"margin-top:0;margin-bottom:0;padding-top:var(--wp--preset--spacing--50);padding-right:var(--wp--preset--spacing--50);padding-bottom:var(--wp--preset--spacing--50);padding-left:var(--wp--preset--spacing--50)\"><!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|40\",\"left\":\"var:preset|spacing|50\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"verticalAlignment\":\"stretch\",\"width\":\"50%\"} -->\n<div class=\"wp-block-column is-vertically-aligned-stretch\" style=\"flex-basis:50%\"><!-- wp:group {\"style\":{\"dimensions\":{\"minHeight\":\"100%\"}},\"layout\":{\"type\":\"flex\",\"orientation\":\"vertical\",\"justifyContent\":\"stretch\",\"verticalAlignment\":\"top\"}} -->\n<div class=\"wp-block-group\" style=\"min-height:100%\"><!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.2\"}},\"fontSize\":\"x-large\",\"fontFamily\":\"heading\"} -->\n<p class=\"has-heading-font-family has-x-large-font-size\" style=\"line-height:1.2\">Études offers comprehensive consulting, management, design, and research solutions. Every architectural endeavor is an opportunity to shape the future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:group {\"layout\":{\"type\":\"constrained\",\"contentSize\":\"300px\",\"justifyContent\":\"left\"}} -->\n<div class=\"wp-block-group\"><!-- wp:paragraph {\"style\":{\"layout\":{\"selfStretch\":\"fixed\",\"flexSize\":\"50%\"}}} -->\n<p>Leaving an indelible mark on the landscape of tomorrow.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:buttons -->\n<div class=\"wp-block-buttons\"><!-- wp:button -->\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link wp-element-button\">About us</a></div>\n<!-- /wp:button --></div>\n<!-- /wp:buttons --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"verticalAlignment\":\"center\",\"width\":\"50%\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center\" style=\"flex-basis:50%\"><!-- wp:image {\"aspectRatio\":\"3/4\",\"scale\":\"cover\",\"className\":\"is-style-rounded\"} -->\n<figure class=\"wp-block-image is-style-rounded\"><img alt=\"\" style=\"aspect-ratio:3/4;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"metadata\":{\"categories\":[\"gallery\",\"featured\",\"portfolio\"],\"patternName\":\"twentytwentyfour/gallery-project-layout\",\"name\":\"Project layout\"},\"align\":\"full\",\"style\":{\"spacing\":{\"padding\":{\"top\":\"var:preset|spacing|50\",\"right\":\"var:preset|spacing|50\",\"bottom\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|50\"},\"margin\":{\"top\":\"0\",\"bottom\":\"0\"}},\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|base-2\"}}}},\"backgroundColor\":\"contrast\",\"textColor\":\"base-2\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group alignfull has-base-2-color has-contrast-background-color has-text-color has-background has-link-color\" style=\"margin-top:0;margin-bottom:0;padding-top:var(--wp--preset--spacing--50);padding-right:var(--wp--preset--spacing--50);padding-bottom:var(--wp--preset--spacing--50);padding-left:var(--wp--preset--spacing--50)\"><!-- wp:columns {\"align\":\"wide\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"var:preset|spacing|50\",\"left\":\"var:preset|spacing|60\"}}}} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"verticalAlignment\":\"stretch\",\"width\":\"60%\",\"style\":{\"spacing\":{\"padding\":{\"right\":\"0\"}}}} -->\n<div class=\"wp-block-column is-vertically-aligned-stretch\" style=\"padding-right:0;flex-basis:60%\"><!-- wp:group {\"style\":{\"dimensions\":{\"minHeight\":\"100%\"}},\"layout\":{\"type\":\"flex\",\"orientation\":\"vertical\",\"verticalAlignment\":\"space-between\",\"justifyContent\":\"stretch\"}} -->\n<div class=\"wp-block-group\" style=\"min-height:100%\"><!-- wp:image {\"aspectRatio\":\"9/16\",\"scale\":\"cover\",\"className\":\"is-style-rounded\"} -->\n<figure class=\"wp-block-image is-style-rounded\"><img alt=\"\" style=\"aspect-ratio:9/16;object-fit:cover\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">1. Through Études, we aspire to redefine architectural boundaries and usher in a new era of design excellence that leaves an indelible mark on the built environment.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"40%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:40%\"><!-- wp:group {\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group\"><!-- wp:paragraph {\"style\":{\"typography\":{\"lineHeight\":\"1.2\",\"fontStyle\":\"normal\",\"fontWeight\":\"500\"}},\"fontSize\":\"large\"} -->\n<p class=\"has-large-font-size\" style=\"font-style:normal;font-weight:500;line-height:1.2\">Our comprehensive suite of professional services caters to a diverse clientele, ranging from homeowners to commercial developers. With a commitment to innovation and sustainability, Études is the bridge that transforms architectural dreams into remarkable built realities.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:spacer {\"height\":\"var:preset|spacing|40\",\"style\":{\"layout\":[]}} -->\n<div style=\"height:var(--wp--preset--spacing--40)\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:group {\"layout\":{\"type\":\"default\"}} -->\n<div class=\"wp-block-group\"><!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">2. Case studies that celebrate the artistry can fuel curiosity and ignite inspiration.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"aspectRatio\":\"9/16\",\"scale\":\"cover\",\"className\":\"is-style-rounded\"} -->\n<figure class=\"wp-block-image is-style-rounded\"><img alt=\"\" style=\"aspect-ratio:9/16;object-fit:cover\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:group --></div>\n<!-- /wp:group --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->', 'Product', '', 'publish', 'closed', 'closed', '', 'wp-custom-template-product-2', '', '', '2024-09-04 09:53:13', '2024-09-04 09:53:13', '', 0, 'http://localhost/test2/2024/09/04/wp-custom-template-product-2/', 0, 'wp_template', '', 0),
