or|base-2\"}}}},\"textColor\":\"base-2\"} -->\n<h3 class=\"wp-block-heading alignwide has-base-2-color has-text-color has-link-color\">What is your process working in smaller projects?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Type / to add a hidden block\",\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast-1\"}}}},\"textColor\":\"contrast-1\"} -->\n<p class=\"has-contrast-1-color has-text-color has-link-color\">Études offers comprehensive consulting, management, design, and research solutions. Our vision is to be at the forefront of architectural innovation, fostering a global community of architects and enthusiasts united by a passion for creating spaces. Every architectural endeavor is an opportunity to shape the future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\",\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|30\",\"bottom\":\"var:preset|spacing|30\"}}},\"backgroundColor\":\"base\"} -->\n<hr class=\"wp-block-separator has-text-color has-base-color has-alpha-channel-opacity has-base-background-color has-background is-style-wide\" style=\"margin-top:var(--wp--preset--spacing--30);margin-bottom:var(--wp--preset--spacing--30)\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading {\"level\":3,\"align\":\"wide\",\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|base-2\"}}}},\"textColor\":\"base-2\"} -->\n<h3 class=\"wp-block-heading alignwide has-base-2-color has-text-color has-link-color\">Who is behind Études?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Type / to add a hidden block\",\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast-1\"}}}},\"textColor\":\"contrast-1\"} -->\n<p class=\"has-contrast-1-color has-text-color has-link-color\">Études offers comprehensive consulting, management, design, and research solutions. Our vision is to be at the forefront of architectural innovation, fostering a global community of architects and enthusiasts united by a passion for creating spaces. Every architectural endeavor is an opportunity to shape the future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\",\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|30\",\"bottom\":\"var:preset|spacing|30\"}}},\"backgroundColor\":\"base\"} -->\n<hr class=\"wp-block-separator has-text-color has-base-color has-alpha-channel-opacity has-base-background-color has-background is-style-wide\" style=\"margin-top:var(--wp--preset--spacing--30);margin-bottom:var(--wp--preset--spacing--30)\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading {\"level\":3,\"align\":\"wide\",\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|base-2\"}}}},\"textColor\":\"base-2\"} -->\n<h3 class=\"wp-block-heading alignwide has-base-2-color has-text-color has-link-color\">I\'d like to get to meet fellow architects, how can I do that?</h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"placeholder\":\"Type / to add a hidden block\",\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast-1\"}}}},\"textColor\":\"contrast-1\"} -->\n<p class=\"has-contrast-1-color has-text-color has-link-color\">Études offers comprehensive consulting, management, design, and research solutions. Our vision is to be at the forefront of architectural innovation, fostering a global community of architects and enthusiasts united by a passion for creating spaces. Every architectural endeavor is an opportunity to shape the future.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:separator {\"className\":\"is-style-wide\",\"style\":{\"spacing\":{\"margin\":{\"top\":\"var:preset|spacing|30\",\"bottom\":\"var:preset|spacing|30\"}}},\"backgroundColor\":\"base\"} -->\n<hr class=\"wp-block-separator has-text-color has-base-color has-alpha-channel-opacity has-base-background-color has-background is-style-wide\" style=\"margin-top:var(--wp--preset--sp